{
  "name": "My Custom Redis",
  "app": "https://github.com/myorg/custom-redis.git",
  "imageURL": "https://example.com/redis-icon.png",
  "category": "database",
  "kind": "git",
  "description": "A custom Redis deployment with enhanced features",
  "readMe": "https://raw.githubusercontent.com/myorg/custom-redis/main/README.md",
  "source": "https://github.com/myorg/custom-redis",
  "branch": "main",
  "version": "v1.0.0",
  "defaultVersion": "7.0",
  "availableVersions": ["7.0", "6.2", "6.0"],
  "dependencies": [],
  "configuration": {
    "settings": {
      "presets": "medium",
      "startCommand": "redis-server /etc/redis/redis.conf",
      "computations": {
        "vcpu": 1,
        "memory": {
          "value": 1024,
          "unit": "MB"
        },
        "replicas": 1,
        "maxReplica": 3
      },
      "storage": [
        {
          "path": "/data",
          "size": 10,
          "persisted": true,
          "enabled": true
        }
      ],
      "policies": {
        "deploymentPolicy": {
          "restartPolicy": "Always",
          "imagePullPolicy": "IfNotPresent",
          "kind": "StatefulSet"
        }
      },
      "network": {
        "main": [
          {
            "name": "redis",
            "port": 6379,
            "targetPort": 6379,
            "protocol": "TCP"
          }
        ]
      }
    },
    "env": {
      "REDIS_PASSWORD": {
        "val": "changeme",
        "description": "Redis password",
        "type": "value"
      },
      "REDIS_MAX_MEMORY": {
        "val": "256mb",
        "description": "Maximum memory usage",
        "type": "value"
      }
    }
  }
}

