request.description:
### POST /billing/deployment-quota/card/topup

This endpoint allows the user to top up the deployment quota card for a specific location and workspace.

#### Request Body

- `Quantity` (number) - The quantity to top up.

- `CallBackURL` (string) - The URL for callback, if any.

- `SelectedCard` (string) - The ID of the selected card for top-up.

- `ApplyCreditBalance` (boolean) - Indicates whether to apply credit balance.


#### Request Parameters

- `location` (string) - The location for the deployment quota card top-up.

- `workspace` (string) - The workspace ID for the deployment quota card top-up.


#### Response

The response is in JSON format and follows the schema below:

``` json
{
  "type": "object",
  "properties": {
    "data": {
      "type": "object",
      "properties": {
        "checkout_url": {
          "type": "string"
        },
        "message": {
          "type": "string"
        }
      }
    },
    "message": {
      "type": "string"
    },
    "success": {
      "type": "boolean"
    }
  }
}

 ```

The response includes the checkout URL, a message, and a success indicator.

#### Example Response

``` json
{
  "data": {
    "checkout_url": "",
    "message": ""
  },
  "message": "",
  "success": true
}

 ```

